    constructor(props){
      super(props);
      this.state = {};
    }

    componentDidMount(){
      this.loadData();
    }

    loadData = async () => {
      try{
        let result = await api.get('/api/v2/pages/');
        this.setState({
          list: result.data
        });
      }catch(e){
        console.log(e)
      }
    }

